    "tiger-line-shapefile-2012-series-information-file-for-the-current-secondary-school-districts-sh",nt"isopen":
    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation. School Districts are single-purpose administrative units within which local
    officials providen               public educational services for the area's residents.
    The Census Bureau obtains the boundaries, names, local education agency codes, grade
    ranges, andn               school district levels for school districts from State
    officials for the primary purpose of providing the U.S. Department of Education
    with estimates ofn               the number of children in poverty within each school
    district. This information serves as the basis for the Department of Education to
    determine then               annual allocation of Title I funding to States and
    school districts. TIGER/Line Files include separate shapefiles for elementary, secondary,
    and unifiedn               school districts. The 2010 Census school district boundaries
    are those in effect for the 2009-2010 school year.",nt"license_title": null,nt"extras":
